export default function(state=null, action){
    switch(action.type){
        case 'UNDONE':
            if(task.status == 'N'){
                return action.payload;
            }
            break;
        case 'DONE':
            if(task.status == 'Y'){
                return action.payload;
            }
            break;
    }
    return state;
}
